import React from 'react'
import {
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button
  } from 'reactstrap';
import "./StudentDashboard.css";


const Ticket = ( { ticket } ) => {

    return (

        <div>
            <Card>
                <CardBody>
        <CardSubtitle>{ticket.ticketNumber}</CardSubtitle>
        <CardSubtitle>{ticket.category}</CardSubtitle>
        <CardTitle>{ticket.title}</CardTitle>
        <CardText>{ticket.description}</CardText>
        <CardText>{ticket.effort}</CardText>
        <Button style={{backgroundColor: "#0066cc"}, {marginRight: "10px"}}>Edit</Button>
        <Button style={{marginRight: "10px"}, {backgroundColor: "#0066cc"}}>Delete</Button>
        <Button>Resolve</Button>
        </CardBody>
        </Card>
        </div>
    )

}

export default Ticket;
